import React from "react";
import "./App.css";
import logo from "./daimon-logo.png"; // Make sure this matches your uploaded image name

function App() {
  return (
    <div className="App" style={styles.container}>
      <img src={logo} alt="Daimon Logo" style={styles.logo} />
      <h1 style={styles.title}>Welcome to Daimon</h1>
      <input
        type="text"
        placeholder="Search..."
        style={styles.searchbar}
      />
    </div>
  );
}

const styles = {
  container: {
    textAlign: "center",
    backgroundColor: "#1e1e2f",
    height: "100vh",
    color: "#fff",
    paddingTop: "10%",
  },
  logo: {
    height: "120px",
    marginBottom: "20px",
  },
  title: {
    fontSize: "2.5rem",
    marginBottom: "30px",
  },
  searchbar: {
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "8px",
    border: "none",
    outline: "none",
    width: "300px",
    maxWidth: "80%",
  },
};

export default App;
